import React from 'react'
import Axios from 'axios'
async function getApi(){
    let data;
    let html = [];
    
    data.forEach(element => {
        let para = ""
        element.forEach(col => {
            para += (col)+", ";
        })
        html.push(para);
    });
    return (html);

}

function Databases(){

    const [array, setArray] = React.setState();
    React.useEffect(() => {
        try {
            Axios.get("/test").then((response) => {
                setArray(response.data.rows)
            })
        } catch (err){
            console.log(err);
        }
    }, [])

    console.log(array)
    return(
        <div>
            <h1>Databases</h1>
        </div>
    )
}

export default Databases;
